void print_flag(){
    FILE *file = fopen("flag.txt", "r");
    char buffer[256]; // Buffer to hold each line
    while (fgets(buffer, sizeof(buffer), file) != NULL) {
        printf("%s", buffer);
    }
    fclose(file);
} 

void calculate(float x[]) {
    time_t t = time(NULL);
    struct tm *tm_info = localtime(&t);
    int time = tm_info->tm_hour * 60 + tm_info->tm_min;
    for (int i = 0; i < 12; i++) {
        x[i] = (x[i] * 2) + (time % 12);         
    }
}

